import {Container, Title, HeaderChess} from '../style/style'
import Image from 'next/image'
import myImage from '../public/chess.png'


function Home () {
    return (
        <Container>
            <HeaderChess imagechess={myImage}>
                {/* <Image width="1000" height="300"  src="/chess.png"/> */}
            </HeaderChess>
        </Container>
    )
}

export default Home
